import React from 'react';
import { Link } from 'react-router-dom';
import { Form, Button, FormGroup, FormControl, ControlLabel } from "react-bootstrap";

export default class Home extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
		IntervieweeEmail : "",
		InterviewerEmail : "",
		Date : "",
		StartTime : "",
		EndTime : "",
    }
  }

  handleInputChanged(event) {
  	var x = event.target.name ;
  	console.log(x);
    this.setState({
      [x]: event.target.value
    });
  }

  handleButtonClicked() {
    var searchQuery = this.state.searchQuery;
    console.log(searchQuery) ;

  }

  render() {
    return  (
  		<div>
      	<Form>
		  <Form.Group className="mb-3" controlId="formBasicEmail">
		    <Form.Label>Interviewee Email address </Form.Label>
		    <Form.Control type="email" name="IntervieweeEmail" value={this.state.IntervieweeEmail} placeholder="Enter email" onChange={this.handleInputChanged.bind(this)}/>
		  </Form.Group>
		  <Form.Group className="mb-3" controlId="formBasicEmail">
		    <Form.Label>Interviewer Email address</Form.Label>
		    <Form.Control type="email" name="InterviewerEmail" value={this.state.InterviewerEmail} placeholder="Enter email" onChange={this.handleInputChanged.bind(this)}/>
		  </Form.Group>

		  <Button variant="primary" type="submit" onClick={this.handleButtonClicked.bind(this)}>
		    Submit
		  </Button>
		</Form>
		</div>
      //   <input type="text" name="searchQuery" value={this.state.searchQuery} onChange={this.handleInputChanged.bind(this)}/>
      //   <button >
      //     Submit
      //   </button>
      // </div>
    );
  }
}
